import React from "react";
import { UserCog, Bell, Plus } from "lucide-react";

const Navbar = ({ title }) => {
  return (
    <header className="h-16 bg-white shadow flex items-center justify-between px-6 border-b">
      {/* Left: Page Title */}
      <h1 className="text-xl font-semibold text-teal-700">{title}</h1>

      {/* Right: Actions */}
      <div className="flex items-center gap-4">
        {/* Quick Add Button */}
        <button className="flex items-center gap-2 bg-teal-600 text-white px-4 py-2 rounded-lg shadow hover:bg-teal-700 transition">
          <Plus size={16} />
          Add
        </button>

        {/* Notifications */}
        <button className="relative p-2 rounded-full hover:bg-gray-100 transition">
          <Bell size={20} />
          <span className="absolute top-0 right-0 w-2 h-2 bg-red-500 rounded-full"></span>
        </button>

        {/* Profile */}
        <button className="flex items-center gap-2 p-2 rounded-full hover:bg-gray-100 transition">
          <UserCog size={20} />
          <span className="hidden sm:inline text-gray-700">Profile</span>
        </button>
      </div>
    </header>
  );
};

export default Navbar;
